import React from "react";
import MyMarker from "./MyMarker"
import axios from "axios";

class RequestMarkers extends React.Component {
  constructor(props){
    super(props)
    this.state = {
      requests: [],
  }
};

componentDidMount() {
 axios.get("http://localhost:3003/requests")
  .then(response => {
    console.log(response.data)
    this.setState({ requests: response.data.requests });
  })
  }

  render() {
    return (
      <div>
        {this.state.requests && this.state.requests.map(request => {
          return (<MyMarker {...this.props} position={{ lat:+request.latitude, lng:+request.longitude }}
            title={request.title} 
            description={request.description}
            request={request}
            key={request.id} 
            request_id={request.id}
            user={this.props.user}/>)
        })
        }
      </div>
    )
  }
}

export default RequestMarkers;


